import React, { useRef } from 'react';

function Button() {
	const CustomControl = ({ position }) => {
		const buttonRef = useRef(null);

		return (
			<div
				ref={buttonRef}
				style={{
					position: 'absolute',
					top: position[0],
					left: position[1],
					zIndex: 1000
				}}
			>
				<button>Tlačítko</button>
			</div>
		);
	};
	return (
		<CustomControl position={[10, 100]} />)
}

export default Button
